import Products from "./components/products";
import Details from "./components/Details";
import Cart from "./components/Cart";





export default function App() {
  return (

    <>
      <div className="content">
        <Header />
        <main>
          <Products/>
        </main>
      </div>
      <Footer />
    </>
  );
}
